import React from "react";
import styles from "./NavBar.module.css";
const NavBar = () => {
  return (
    <header className={styles.header}>
      <div className={styles.logo}>
        Wiki<span className={styles.who}>WHO</span>
      </div>
      <nav className={styles.nav}>
        <ul>
          <li>
            <a>All Quotes</a>
          </li>
          <li>
            <a>Add a Quote</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
